(353,	'2012-10-05 15:15:32',	'deepervibrations@massivemusic.fr',	'DeeperVibrations',	'ecc19b2704c51d6ac273ff4d9e9c0cb2e6916370',	'ROBOT',	'dbc4fa29640f2bd8e158dec55d33789527c06582b771cffee102ade1cae08b5a18d5f594445b0d249cbbc3df8fcb1b6a3bbfb8d49ad848cfc4a4670691089f85',	NULL,	'2020-10-19 21:27:37.965',	'UCUhTyFtH3F5Nt3J82dlx7nQ',	1,	'2020-10-19 21:27:38',	1,	'Pure bass music, focused on the deeper, more minimal side of dubstep and drum & bass.\r\nWe are always open to working with artists and labels that fit our sound, so if you would like to have your music featured on the channel, please do contact us.\r\nWe are not affiliated with any artists or labels though and we ONLY put music up because we love it, not through offers of money or free merchandise! \r\nFinally, we do not make any profits- our purpose is simply to spread the music we love for those who appreciate it as much as we do :)\r\n\r\nIf you would like your track featured on the channel, please e-mail it to admin@deepervibrations.co.uk or contact us via one of the links below...We\'ll do our best to listen to all tunes and will try and provide some feedback.\r\n\r\n\"All matter is merely energy condensed to a slow vibration. We are all one consciousness experiencing itself subjectively. There is no such thing as death, life is only a dream and we are the imagination of ourselves.\" - Bill Hicks.',	'https://yt3.ggpht.com/a/AATXAJwVQpxiDKFh5D_X9nHVSmPEh3sAG2oV0BMJPzFF=s88-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJwVQpxiDKFh5D_X9nHVSmPEh3sAG2oV0BMJPzFF=s176-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJwVQpxiDKFh5D_X9nHVSmPEh3sAG2oV0BMJPzFF=s176-c-k-c0x00ffffff-no-rj-mo',	NULL),
(354,	'2012-10-07 18:14:17',	'criticalmusic@massivemusic.fr',	'CriticalMusic',	'ecc19b2704c51d6ac273ff4d9e9c0cb2e6916370',	'ROBOT',	'dbc4fa29640f2bd8e158dec55d33789527c06582b771cffee102ade1cae08b5a18d5f594445b0d249cbbc3df8fcb1b6a3bbfb8d49ad848cfc4a4670691089f85',	NULL,	'2020-10-19 21:28:24.293',	'UCfYsxyFjsWcmDVGuXC3gzJg',	2,	'2020-10-19 21:28:24',	1,	'Conceived by D&B visionary Kasra back in 2002, in a front room in north London, the Critical Music name has since blossomed into one of the most successful independent record labels in the UK today. Grown from a simple idea driven by a commitment to putting out the best music the scene has to offer, it has now become one of the most well respected electronic dance music labels in the UK. Nurturing new talent and releasing some of the freshest breaks and beats from the cream of the scene, it has gone on to build a loyal following around the world driven on by Kasra’s never ending quest to release quality underground bass music.\r\n\r\nNot only a record label, the Critical empire now boasts it’s own highly esteemed club nights with a residency at Londons world-renowned fabric night spot, as well as regular branded Critical tour nights across the UK and abroad. Drawing in familiar faces from the world of D&B you can be sure each and every Critical Sound event is programmed to perfection.',	'https://yt3.ggpht.com/a/AATXAJxJLAfy5eJlRLSfIb2gGzcj8Y3AsDdB1cqZuRReZw=s88-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJxJLAfy5eJlRLSfIb2gGzcj8Y3AsDdB1cqZuRReZw=s176-c-k-c0x00ffffff-no-rj-mo',	'https://yt3.ggpht.com/a/AATXAJxJLAfy5eJlRLSfIb2gGzcj8Y3AsDdB1cqZuRReZw=s176-c-k-c0x00ffffff-no-rj-mo',	NULL),
